import { ProgressBar, Step } from "react-step-progress-bar";

function Progressbar(props) {
  return (
    <ProgressBar percent="" filledBackground="">
      {props.items.map((item) => (
        <Step transition="scale">{item}</Step>
      ))}
    </ProgressBar>
  );
}

export default Progressbar;
